    <React.Fragment>
      <div style={
      {"position": "absolute",
      "left": "50%",
      "top": "30%",
      "transform": "translate(-50%, -50%)",
      }} > 
        <Map />
      <p>{selectedArea}</p>
      <button> Start </button>

      </div>

    </React.Fragment>
  )
}
